const Quests = () => {
  const [active, setActive] = useState();

  const items = [
    {
      label: "Quests",
      icon: "pi pi-fw pi-book",
      items: [
        {
          label: "New",
          icon: "pi pi-fw pi-plus",
          command: (event) => {},
        },
        {
          label: "Delete",
          icon: "pi pi-fw pi-trash",
          command: (event) => {
            console.log("delete item");
          },
        },
      ],
    },
  ];

  return (
    <>
      <PanelMenu model={items} />
    </>
  );
};

export default Quests;
